        return (
            <article className="journey">
                <div className="img-container">
                    {/* <img src={img} alt="company" /> */}
                </div>
                <div className="journey-info">
                    <h2>{name}</h2>
                    {/* <Link target={"_blank"} to={link}>{link}</Link>   */}
                    <Link onClick={openTab}>{link}</Link>
                    <p> {tech} </p>
                </div>
            </article>
        )
    }
}
